%[text] [(2 封私信) Wilson Loop计算Wannier Function Center演化并确定Z\_2不变量(BHZ model & Kane Mele model)(Mathematica/Matlab) - 知乎](https://zhuanlan.zhihu.com/p/661862820)
%[text] # BHZ模型 WilsonLoop
%[text] 

clear;
% 优化后的BHZ模型能带与Wilson环相位计算
% ----------- 能带计算向量化 -----------
n1 = 201;
l = linspace(0, 1, n1);

Gamma = [0, 0]; M = [pi, 0]; K = [pi, pi];

% 路径参数批量生成
l1 = l(1:end-1);
l2 = l(1:end-1);
l3 = l;

% 路径点批量生成
kpath1 = [M(1)*l1; M(2)*l1];
kpath2 = [(K(1)-M(1))*l2+M(1); (K(2)-M(2))*l2+M(2)];
kpath3 = [(Gamma(1)-K(1))*l3+K(1); (Gamma(2)-K(2))*l3+K(2)];

kx_all = [kpath1(1,:), kpath2(1,:), kpath3(1,:)];
ky_all = [kpath1(2,:), kpath2(2,:), kpath3(2,:)];

num_k = numel(kx_all);
band = zeros(4, num_k);

% 向量化能带计算
for idx = 1:num_k
    energy = eig(hamiltonianBHZ(kx_all(idx), ky_all(idx)));
    band(:, idx) = sort(energy);
end

% 绘制能带
figure; hold on; %[output:389b3ddf]
colors = lines(4);
for i = 1:4
    scatter(1:num_k, band(i,:), 1, 'filled', 'MarkerFaceColor', colors(i,:)); %[output:389b3ddf]
end
xlabel('k-path'); ylabel('Energy'); title('BHZ Model Band Structure'); %[output:389b3ddf]
box on; %[output:389b3ddf]

% ------------------BHZ哈密顿量定义------------------
function h = hamiltonianBHZ(kx, ky)
    a = 1;
    A = -13.68; B = -16.9; C = -0.0263; D = -0.514; M = -2.058; Delta = 1.2;
    s0 = eye(2); s1 = [0, 1; 1, 0]; s2 = [0, -1j; 1j, 0]; s3 = [1, 0; 0, -1];
    h1 = (C - 2*D/a^2*(2-cos(kx)-cos(ky)))*s0 + A/a*sin(kx)*s1 + A/a*sin(ky)*s2 ...
        - 2*B/a^2*(2-M/(2*B)-cos(kx)-cos(ky))*s3;
    h2 = (C - 2*D/a^2*(2-cos(kx)-cos(ky)))*s0 + A/a*sin(-kx)*s1 + A/a*sin(-ky)*(-s2) ...
        - 2*B/a^2*(2-M/(2*B)-cos(kx)-cos(ky))*s3;
    heff = blkdiag(h1, h2);
    hp = [0,0,0,-1j*Delta;0,0,1j*Delta,0;0,-1j*Delta,0,0;1j*Delta,0,0,0];
    h = hp + heff;
end

% ------------------Wilson环相位计算------------------
N = 2; Ny = 1001; Nx = 100; % N: 占据态数目, Nx, Ny: k空间采样点数
value = zeros(N, Ny); % 存储Wilson环本征值

for j = 1:Ny
    ky = 2 * pi * (j - 1) / (Ny - 1) - pi; % k_y取值
    Vector = zeros(N, Nx, 4); % 占据态矢量
    for i = 1:Nx
        kx = (i - 1) * 2 * pi / Nx - pi; % k_x取值
        [V, D] = eig(hamiltonianBHZ(kx, ky));
        [~, ind] = sort(diag(D));
        Vs = V(:, ind); % 按能量升序排列
        for j1 = 1:N
            Vector(j1, i, :) = Vs(:, j1);
        end
    end
    DM = eye(N); % Wilson环转移矩阵
    for i = 1:(Nx - 1)
        F = zeros(N);
        for m = 1:N
            for n = 1:N
                F(m, n) = dot(squeeze(Vector(m, i, :)), squeeze(Vector(n, i + 1, :)));
            end
        end
        DM = DM * F;
    end
    % 闭合环
    F1 = zeros(N);
    for m = 1:N
        for n = 1:N
            F1(m, n) = dot(squeeze(Vector(m, Nx, :)), squeeze(Vector(n, 1, :)));
        end
    end
    DM = DM * F1;
    value(:, j) = eig(DM); % 记录本征值
end

% 绘制Wilson环相位
anglev = angle(value) / (2 * pi);
Ky = ((1:Ny) - 1) / (Ny - 1) - 0.5;
figure; %[output:3d2147ad]
hold on; %[output:3d2147ad]
scatter(Ky, anglev(1, :), 1, "blue"); %[output:3d2147ad]
scatter(Ky, anglev(2, :), 1, "red"); %[output:3d2147ad]
xlabel("k_y/(2\pi)"); %[output:3d2147ad]
ylabel("\phi/(2\pi)"); %[output:3d2147ad]
axis([-0.5 0.5 -0.5 0.5]); %[output:3d2147ad]
title('Wilson Loop Phases'); %[output:3d2147ad]
box on; %[output:3d2147ad]
hold off %[output:3d2147ad]



